                        a[less] = a[great];
                        ++less;
                    } else { // a[great] == pivot
                        a[k] = pivot;
                    }
                    a[great] = ak;
                    --great;
                }
            }

            /*
             * 
             */
            sort(a, left, less - 1, leftmost);
            sort(a, great + 1, right, false);
        }
